fields.desc_presenter:
•	Sturdy and spacious camera backpack, provides quick access due to two-way zip•	Space for a digital SLR camera with lens, 8 additional lenses/flash and further accessories•	Flexible interior layout due to hook-and-loop fastenings - the photo equipment and personal affects can be stored inside the backpack•	Stabilizer for the lens•	Loading from the back, therefore protected against theft•	Two large, elastic side compartments; 1×with bottle holder•	Mesh compartment inside•	Three inner compartments for full/empty batteries and filters•	Inner compartments for full/empty memory cards and cleaning cloth (included in delivery)•	Padded shoulder straps, hip belt, back and handle•	Shoulder strap and hip belt with loops for attaching additional accessories•	Adjustable chest strap•	Loop for attaching a tripod etc. (top); 
tripod pouch (bottom)•	Rubberized, water-repellent and 
easy-to-clean base•	Rain protection cover•	Reflective piping•	Weight: 1470 g•	Dimension: 18×28×32 cm
